        return 18;
    }

    /**
     * @dev See {IERC20-totalSupply}.
     */
    function totalSupply() public view virtual override returns (uint256) {
        return _totalRealAccumulated;
    }

    /**
     * @dev See {IERC20-balanceOf}.
     */
    function balanceOf(address account) public view virtual override returns (uint256) {
        uint lastEpochDepositNumber = _epochNumber(_depositQueue[account].lastRequestedTime);
        uint lastEpochWithdrawNumber = _epochNumber(_withdrawQueue[account].lastRequestedTime);
        uint currentEpochNumber = _epochNumber(block.timestamp);

        uint realBalance = _balances[account];
        if(currentEpochNumber - lastEpochDepositNumber > 0) {
            realBalance = realBalance + _depositQueue[account].pendingAmount;
        }
        if(currentEpochNumber - lastEpochWithdrawNumber > 0) {
            realBalance = realBalance > _withdrawQueue[account].pendingAmount ? realBalance - _withdrawQueue[account].pendingAmount : 0;
        }

        return realBalance;
    }

    /**
